import React, {Component} from 'react';
import WikiNav from "../../components/WikiNav";
import wikiStyle from './index.module.css';

class Wiki extends Component {
    render() {
        return (
            <div className={wikiStyle.frame}>
                <WikiNav className={wikiStyle.nav}/>
            </div>
        );
    }
}

export default Wiki;
